import { Component } from '@angular/core'

@Component({
  selector: 'app-object',
  templateUrl: './object.component.html',
  styleUrls: ['./object.component.css'],
})
export class ObjectComponent {
  person: any = {
    name: 'Владимир',
    lastname: 'Ленин',
    isProgrammer: true,
  }
}
